const getLoactions = async () => {
  loading.value = true;
  if (locale.value === "ar") {
    const { data: productsData, pending } = await useFetch(
      `${api.GetAllLocations}`,
      {
        credentials: "include",
        baseURL: apiBase,
        headers: {
          "accept-language": "ar",
        },
      }
    );
