      if (process.client) {
        if (productsData.value) {
          Loactions.value = productsData.value;
        }
      }
    });
  } else {
    const { data: productsData, pending } = await useFetch(
      `${api.GetAllLocations}`,
      {
        credentials: "include",
        baseURL: apiBase,
        headers: {
          "accept-language": "en",
        },
      }
    );
    watchEffect(() => {
      if (process.client) {
        if (productsData.value) {
          Loactions.value = productsData.value;
        }
      }
    });
  }
  loading.value = false;
};
//init
getLoactions();

const DeleteLocation = async () => {
  const { RemovePlant, error } = await useFetch(
    `${api.DeleteLocation}/${deleteRegion.value.id}`,
    {
      credentials: "include",
      baseURL: apiBase,
      method: "DELETE",
    }
  );

  // re get the product
  getLoactions();

  deleteModal.value = false;
  //message
  locale.value === "en"
