        durations: { global: 5000 },
      })
    : $awn.success("تم حذف المنطقة بنجاح", {
        durations: { global: 5000 },
      });
};

const addLocation = async () => {
  visible.value = false;
  const { AddProduct, error } = await useFetch(api.AddLocation, {
    baseURL: apiBase,
    method: "POST",
    credentials: "include",
    body: {
      location_name_AR: nameAr.value,
      location_name_EN: nameEn.value,
      price: price.value,
    },
  });

