        durations: { global: 5000 },
      })
    : $awn.success("تم إضافة المنطقة بنجاح", {
        durations: { global: 5000 },
      });
};

let editedCat = ref();
const editfunc = async () => {
  const { data: ar } = await useFetch(
    `${api.GetLocationById}/${editedCat.value.id}`,
    {
