      credentials: "include",
      baseURL: apiBase,
      headers: {
        "accept-language": "en",
      },
    }
  );

  editnameAr.value = ar.value.name;
  editnameEn.value = en.value.name;
  editPrice.value = en.value.price;
};

const editLocation = async () => {
  visible2.value = false;
