    `${api.UpdateLocation}/${editedCat.value.id}`,
    {
      credentials: "include",
      body: {
        location_name_AR: editnameAr.value,
        location_name_EN: editnameEn.value,
        price: editPrice.value,
      },
      baseURL: apiBase,
      method: "PUT",
    }
  );

  // re get the product
  getLoactions();

  editnameAr.value = "";
  editnameEn.value = "";
  editPrice.value = 0;

  //message
  locale.value === "en"
